SET FOREIGN_KEY_CHECKS = 0;

DROP TABLE IF EXISTS `address`;
DROP TABLE IF EXISTS `brand`;
DROP TABLE IF EXISTS `category`;
DROP TABLE IF EXISTS `item`;
DROP TABLE IF EXISTS `order`;
DROP TABLE IF EXISTS `order_item`;
